import React from "react";
import styled from "styled-components";
import { LIElement, ULElement } from "../Footer/style";

const HeaderContainer = styled.header`
  width: 100%;
  height: 100%;
  display: flex;
`;

function Index() {
  return (
    <>
      <HeaderContainer>
        <ULElement>
          <LIElement>Home</LIElement>
        </ULElement>
      </HeaderContainer>
    </>
  );
}

export default Index;
